import { Component, Prop, Vue } from 'vue-property-decorator';
import { mapGetters } from 'vuex';

@Component({
  computed: mapGetters(['conferenceStart'])
})
export default class About extends Vue {

  presentPopover(event){
    console.log('click', event)
  }
}
